import React, { FC } from "react";
import style from "styled-components";
import { AddPost } from "../icon";

const Container = style.div`
    position: fixed;
    bottom: 50px;
    right: 50px;
`;

const AddPostBtn: FC = () => (
  <Container>
    <AddPost style={{ width: 50, height: 50 }} />
  </Container>
);
export default AddPostBtn;
